import React from 'react'
import { Layout, Avatar,Button } from 'antd';

const {Header, Sider, Content} = Layout;

const CommonHeader = () => {
    return (
        <Header >
            <Button
                type="text"
                style={{
                    fontSize: '16px',
                    width: 64,
                    height: 64,
                }}
            />
            <avatar src={<img src={require("../../assets/images/user.png")}/>}/>
        </Header>
    )
}
export default CommonHeader
